INSERT INTO `season` VALUES (1,'2021-06-04 03:11:03','2021-06-04 03:11:03',1,4,'Aves Season 1',3,'Goldfinch wins the first scoreboard season on a goal diff tiebreaker','HOME_ROTATION'),(2,'2020-04-10 07:00:00','2020-04-10 07:00:00',1,8,'Aves Season 2',6,'Oriole wins season 2.','HOME_ROTATION'),(3,'2020-04-20 07:00:00','2020-04-20 07:00:00',1,16,'Aves Season 3',8,'Woodpecker wins season 3.','HOME_ROTATION'),(4,'2021-01-26 02:00:52','2021-02-18 00:43:04',1,8,'Aves Season 4',1,'Hummingbird and Goldfinch break away from the pack both winning an improbable number of away games. Hummingbird prevails and wins the season losing only 2 games to Goldfinch and 1 to Sparrow.','HOME_ROTATION'),(5,'2021-03-01 20:16:07','2021-04-01 00:33:00',1,32,'Aves Season 5',19,'Penguin runs away with Season 5 with an improbable home stand.','HOME_ROTATION'),(6,'2021-04-12 21:01:22','2021-04-16 00:09:18',1,4,'Aves Season 6',3,'Goldfinch wins season 6. This was the first season scheduled using the Rounds algorithm.','ROUNDS'),(7,'2021-06-04 03:11:03','2021-06-04 03:11:03',1,4,'Aves Season 7',8,'Woodpecker wins season 7. This was the first season played using the react ui. Before this the back end was used by itself.','ROUNDS'),(8,'2021-06-21 11:45:07','2021-06-21 11:47:06',1,4,'Aves Season 8',10,'Bluebird wins 3 straight away games and takes season 8. This was the first season where two games were played simultaneously','ROUNDS'),(9,'2021-08-22 05:22:59','2021-08-22 05:22:59',1,4,'Aves Season 9',15,'Killdeer was 1-5-1 25% through the games, but made a remarkable comeback going 14-2-1 from that point, and winning 8 of their last 9 to finish. Purple Martin seemed to be in the driver\'s seat for most of the competition, but lost their last 5 taking themselves out of the running. Mockingbird hung around the whole way and lead briefly, but had a lot of away games towards the end and couldn\'t keep up with Killdeer. Morning Dove started strong at 4-1-0, but completely collapsed from that point and finished 15 points off the lead. This was the last of 4 seasons of the schedule type ROUNDS featuring the front half of the league in their groups of 4.','ROUNDS'),(10,'2021-10-04 04:56:09','2021-10-04 04:57:47',1,8,'Aves Season 10',NULL,'This was the first seaon with type ROUNDS with 8 teams. Robin captures their first season winning their last 5 games and going 5-0 at home. It ended in dramatic fashion with Robin and Oriole playing each other in the final round tied at 14 points. The winner take all game went into overtime where Robin scored to take season 10.','ROUNDS');
