INSERT INTO `season` VALUES (9,'2021-08-21 22:22:59','2021-08-21 22:22:59',1,4,'Aves Season 9',15,'Killdeer was 1-5-1 25% through the games, but made a remarkable comeback going 14-2-1 from that point, and winning 8 of their last 9 to finish. Purple Martin seemed to be in the driver\'s seat for most of the competition, but lost their last 5 taking themselves out of the running. Mockingbird hung around the whole way and lead briefly, but had a lot of away games towards the end and couldn\'t keep up with Killdeer. Morning Dove started strong at 4-1-0, but completely collapsed from that point and finished 15 points off the lead. This was the last of 4 seasons of the schedule type ROUNDS featuring the front half of the league in their groups of 4.','ROUNDS');
